export default App;

function App() {
  return (
    <div className="app">
      <Header />
      <Form />
      <PackagingList />
      <Footer />
    </div>
  );
}

function Header() {
  return (
    <div>
      <h1>Let's Go To Travel</h1>
    </div>
  );
}

function Form() {
  const options = [];
  for (let i = 1; i <= 100; i++) {
    options.push(
      <option key={i} value={i}>
        {i}
      </option>
    );
  }

  return (
    <div className="add-form">
      <span>
        <h3>What does you need for your trip?</h3>
      </span>
      <select>{options}</select>
      <input type="text" />
      <button>Add</button>
    </div>
  );
}

function PackagingList() {
  return (
    <div className="list">
      <ul>
        <li>
          <input type="checkbox" /> Paaport
        </li>
      </ul>
    </div>
  );
}

function Footer() {
  return (
    <footer className="stats">
      <em>
        You have packed x items on your list , and you already packed x (x %)
      </em>
    </footer>
  );
}
